import React from 'react';
import { ListGroup, ListGroupItem, Jumbotron, Container } from 'reactstrap';
// import linkList from "./modals"


function DisplayLink(props) {

   return (
       <Container>
       <Jumbotron fluid>
        <Container fluid>
          <h1 className="display-3">Links for Sharing</h1>
        </Container>
      </Jumbotron>
       <ListGroup>
        { props.link.map((data, index) => {
           return (
               <ListGroupItem>
               <a key={index} href={data.url}>{data.url}</a>
               </ListGroupItem>
           )
        })}
       </ListGroup>
       </Container>
    )
}

export default DisplayLink;
